import React from 'react';
import { Link } from 'react-router-dom'; // If you're using React Router for navigation
import { AiFillHome } from "react-icons/ai";

const Footer = () => {
  return (
    <footer style={{ position: 'fixed', bottom: 0, left: 0, width: '100%', height: '50px', background: '#333', display: 'flex', justifyContent: 'space-around', alignItems: 'center', color: '#fff' }}>
      <Link to="/" style={{ textDecoration: 'none', color: '#fff' }}><AiFillHome /></Link>
      <Link to="/contact" style={{ textDecoration: 'none', color: '#fff' }}>Contact</Link>
    </footer>
  );
}

export default Footer;
